import './App.css';
import bgImage from '../src/images/background.jpg';
import logo from '../src/images/logo.webp';
import uit from "../src/images/uit1.jpg";
import Component from './components/Component';
import Paragraph from './components/Paragraph';
import '../src/components/Component.css';

function App() {
  return (
    <div className="App">
      <div className='header'>
      <img src={bgImage} alt="bgImage" className='bg-image' />
      <img src={logo} alt="Logo" className='logo-image' />
      <Component image={bgImage} />
        <Component image={logo} className="logo-image" />
        <Paragraph paragraph="Arcgate Foundation, a not-for-profit initiative, focuses on improving the local community through programs in the areas of education, healthcare, sports and rural development. Our mission is to support the less privileged sections of the society through various efforts that will help create a brighter future." />
      </div>
    </div>
  );

}

export default App;
